    {
      "lineNumber": 126391,
      "originalJapaneseLine": "「！？！？！？」",
      "translatedEnglishLine": "\"!?!?\""
    },
    {
      "lineNumber": 126392,
      "originalJapaneseLine": "「ぺ、ペッしろ！　ペッ！」",
      "translatedEnglishLine": "\"Spit it out! Spit!\""
    },
    {
      "lineNumber": 126393,
      "originalJapaneseLine": "「うむ……うん……」",
      "translatedEnglishLine": "\"Um... yeah...\""
    },
    {
      "lineNumber": 126394,
      "originalJapaneseLine": "「う、う……",
      "translatedEnglishLine": "\"U-uh...\""
    },
    {
      "lineNumber": 126395,
      "originalJapaneseLine": "　お、美味しい……か？」",
      "translatedEnglishLine": "\"I-Is it... tasty...?\""
    },
    {
      "lineNumber": 126396,
      "originalJapaneseLine": "「いや、美味しくはない」",
      "translatedEnglishLine": "\"No, it’s not delicious.\""
    },
    {
      "lineNumber": 126397,
      "originalJapaneseLine": "「う……」",
      "translatedEnglishLine": "\"Ugh...\""
    },
    {
      "lineNumber": 126398,
      "originalJapaneseLine": "「だが、ノワールが",
      "translatedEnglishLine": "\"But, since Noir"
    },
    {
      "lineNumber": 126399,
      "originalJapaneseLine": "　作ってくれたものだからな」",
      "translatedEnglishLine": "made it for me...\""
    },
    {
      "lineNumber": 126400,
      "originalJapaneseLine": "ひょい、ぱく。",
      "translatedEnglishLine": "Quickly, munch."
    },
    {
      "lineNumber": 126401,
      "originalJapaneseLine": "政宗はもう一度すくい取って食べた。",
      "translatedEnglishLine": "Masamune scooped it up and ate once more."
    },
    {
      "lineNumber": 126402,
      "originalJapaneseLine": "「政宗……」",
      "translatedEnglishLine": "\"Masamune...\""
    },
    {
      "lineNumber": 126403,
      "originalJapaneseLine": "「もういい、もう食べなくていい」",
      "translatedEnglishLine": "\"Enough, you don't have to eat anymore.\""
    },
    {
      "lineNumber": 126404,
      "originalJapaneseLine": "「政宗……」",
      "translatedEnglishLine": "\"Masamune...\""
    },
    {
      "lineNumber": 126405,
      "originalJapaneseLine": "「あり……」",
      "translatedEnglishLine": "\"Tha...\""
    },
    {
      "lineNumber": 126406,
      "originalJapaneseLine": "「う……」",
      "translatedEnglishLine": "\"Ugh...\""
    },
    {
      "lineNumber": 126407,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "「............」"
    },
    {
      "lineNumber": 126408,
      "originalJapaneseLine": "「ありがとう」",
      "translatedEnglishLine": "\"Thank you.\""
    },
    {
      "lineNumber": 126409,
      "originalJapaneseLine": "「ああ」",
      "translatedEnglishLine": "\"Yeah.\""
    },
    {
      "lineNumber": 126410,
      "originalJapaneseLine": "「政宗……政宗……」",
      "translatedEnglishLine": "\"Masamune... Masamune...\""
    },
    {
      "lineNumber": 126411,
      "originalJapaneseLine": "ぎゅっ。",
      "translatedEnglishLine": "Squeeze."
    },
    {
      "lineNumber": 126412,
      "originalJapaneseLine": "ノワールが政宗を強く抱きしめる。",
      "translatedEnglishLine": "Noir embraced Masamune tightly."
    },
    {
      "lineNumber": 126413,
      "originalJapaneseLine": "「またいずれ、機会があれば作ってくれるか」",
      "translatedEnglishLine": "\"Will you make it again if there’s another opportunity someday?\""
    },
    {
      "lineNumber": 126414,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "“............”"
    },
    {
      "lineNumber": 126415,
      "originalJapaneseLine": "「……うん」",
      "translatedEnglishLine": "\"...Yeah.\""
    },
    {
      "lineNumber": 126416,
      "originalJapaneseLine": "更に強く、より強く、",
      "translatedEnglishLine": "Even stronger, more tightly,"
    },
    {
      "lineNumber": 126417,
      "originalJapaneseLine": "ノワールは政宗を抱きしめた。",
      "translatedEnglishLine": "Noir held Masamune in an even tighter embrace."
    },
    {
      "lineNumber": 126418,
      "originalJapaneseLine": "「ふーん」",
      "translatedEnglishLine": "\"Hmm.\""
    },
    {
      "lineNumber": 126419,
      "originalJapaneseLine": "「ん？」",
      "translatedEnglishLine": "\"Hm?\""
    },
    {
      "lineNumber": 126420,
      "originalJapaneseLine": "「政さん呼んだの、お町姐さん？」",
      "translatedEnglishLine": "\"Did Omae-neesan call for Masa-san?\""
    },
    {
      "lineNumber": 126421,
      "originalJapaneseLine": "「さてな……」",
      "translatedEnglishLine": "\"Who knows...\""
    },
    {
      "lineNumber": 126422,
      "originalJapaneseLine": "「姐さん、ノワールと野菊に甘くなぁい？」",
      "translatedEnglishLine": "\"Neesan, aren’t you being too lenient with Noir and Nogiku?\""
    },
    {
      "lineNumber": 126423,
      "originalJapaneseLine": "「ふふ、さぁてな」",
      "translatedEnglishLine": "\"Hehe, well, who knows.\""
    },
    {
      "lineNumber": 126424,
      "originalJapaneseLine": "「そら、いつまで我の梵天丸を",
      "translatedEnglishLine": "\"Come on, how long are you going to keep holding my Bontenmaru"
    },
    {
      "lineNumber": 126425,
      "originalJapaneseLine": "　抱きしめておる」",
      "translatedEnglishLine": "in your arms?\""
    },
    {
      "lineNumber": 126426,
      "originalJapaneseLine": "「そろそろ夕餉-ﾕｳｹﾞ-としようぞ」",
      "translatedEnglishLine": "\"It’s about time for supper.\""
    },
    {
      "lineNumber": 126427,
      "originalJapaneseLine": "「あっ、お町ずるいぞ！」",
      "translatedEnglishLine": "\"Ah, Omae, that’s unfair!\""
    },
    {
      "lineNumber": 126428,
      "originalJapaneseLine": "「さーご飯の話してたらお腹空いちゃったねー」",
      "translatedEnglishLine": "\"Talking about food like that makes me hungry!\""
    },
    {
      "lineNumber": 126429,
      "originalJapaneseLine": "「政宗様、今日は野菊があーんさせて頂きますー」",
      "translatedEnglishLine": "\"Masamune-sama, today Nogiku will feed you—\""
    },
    {
      "lineNumber": 126430,
      "originalJapaneseLine": "「お前ら来るな。",
      "translatedEnglishLine": "\"You guys, don’t come over."
    },
    {
      "lineNumber": 126431,
      "originalJapaneseLine": "　今はノワールと政宗がらぶらぶする時間」",
      "translatedEnglishLine": "Now is the time for Noir and Masamune to be lovey-dovey.\""
    },
    {
      "lineNumber": 126432,
      "originalJapaneseLine": "「あー、ずるいー。",
      "translatedEnglishLine": "\"Aaah, that’s not fair—"
    },
    {
      "lineNumber": 126433,
      "originalJapaneseLine": "　そんな時間って誰が決めたのよー」",
      "translatedEnglishLine": "Who decided there’s such a thing as that time?\""
    },
    {
      "lineNumber": 126434,
      "originalJapaneseLine": "「ノワール」",
      "translatedEnglishLine": "\"Noir.\""
    },
    {
      "lineNumber": 126435,
      "originalJapaneseLine": "「なによそれー」",
      "translatedEnglishLine": "\"What’s that supposed to mean?\""
    },
    {
      "lineNumber": 126436,
      "originalJapaneseLine": "「さーさー、政さん、こっちに」",
      "translatedEnglishLine": "\"Come on, come on, Masa-san, over here.\""
    },
    {
      "lineNumber": 126437,
      "originalJapaneseLine": "「これこれ、折女。",
      "translatedEnglishLine": "\"Here, here, Orihime,"
    },
    {
      "lineNumber": 126438,
      "originalJapaneseLine": "　梵天丸はこっちに座るのだ」",
      "translatedEnglishLine": "Bontenmaru sits over here.\""
    },
    {
      "lineNumber": 126439,
      "originalJapaneseLine": "「ふふ、お前らは本当に仲がいいな」",
      "translatedEnglishLine": "\"Hehe, you two really get along well.\""
    },
    {
      "lineNumber": 126440,
      "originalJapaneseLine": "今日も政宗の嫁達は賑やかだった。",
      "translatedEnglishLine": "Today too, Masamune’s wives were lively."
    },
    {
      "lineNumber": 126441,
      "originalJapaneseLine": "「政宗……」",
      "translatedEnglishLine": "\"Masamune...\""
    },
    {
      "lineNumber": 126442,
      "originalJapaneseLine": "「ん、ここにいるぞ」",
      "translatedEnglishLine": "\"Hm, I’m here.\""
    },
    {
      "lineNumber": 126443,
      "originalJapaneseLine": "「うん……」",
      "translatedEnglishLine": "\"Yeah...\""
    },
    {
      "lineNumber": 126444,
      "originalJapaneseLine": "ノワールが裸のまま、政宗を抱きしめていた。",
      "translatedEnglishLine": "Noir, completely naked, was embracing Masamune."
    },
    {
      "lineNumber": 126445,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "“............”"
    },
    {
      "lineNumber": 126446,
      "originalJapaneseLine": "「どうした？」",
      "translatedEnglishLine": "\"What’s wrong?\""
    },
    {
      "lineNumber": 126447,
      "originalJapaneseLine": "ノワールが周りをキョロキョロしていた。",
      "translatedEnglishLine": "Noir was looking around restlessly."
    },
    {
      "lineNumber": 126448,
      "originalJapaneseLine": "「ん、いや……」",
      "translatedEnglishLine": "\"Hm, no...\""
    },
    {
      "lineNumber": 126449,
      "originalJapaneseLine": "「二人だけなのが寂しいか？」",
      "translatedEnglishLine": "\"Are you lonely just the two of us?\""
    },
    {
      "lineNumber": 126450,
      "originalJapaneseLine": "「そんなことない。」",
      "translatedEnglishLine": "\"Not at all.\""
    }
  ]
}

